import React from 'react'
import TarjetaAuditoria from './TarjetaAuditoria'

export default function Auditorias(auditorias) {
    const {audits} = auditorias
    return (
        
        <div className="auditoria-list section">
            {audits && audits.map(auditoria => {
                return (
                    <TarjetaAuditoria 
                    auditoria={auditoria}
                    key={auditoria._id}
                    />
                )
            })}

            
        </div>
    )
}
